    require(addressDustBalance[msg.sender] >= _mintAmount * 3, "Not enough MoonDust for mint");

    addressMintedBalance[msg.sender] += _mintAmount;
    addressDustBalance[msg.sender] -= _mintAmount * 3;
    _safeMint(msg.sender, _mintAmount);
  }


